pragma solidity ^0.8.0;
contract User{
    address public owner;
    constructor(){
        owner= (msg.sender);
    }

    function pay() public payable returns(bool){
        if((msg.value)>=2 ether){
            return true;
        }

        else{
            return false;
        }
    }
}

